import React from "react";
import "./index.css";
import Slotmachine from "./Slotmachine";

const App = () => {
  return (
    <>
      <h1 className="heading_style">
        🎰 <span>Slot Machine Game</span> 🎰
      </h1>
      <div className="slotMachine">
        <Slotmachine x="😆" y="😆" z="😆" />
        <Slotmachine x="😮" y="👱" z="☠️" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="😆" z="😆" />
        <Slotmachine x="😆" y="💃" z="👶" />
      </div>
    </>
  );
};

export default App;
